import Practise from "./Practise";

function App() {
  return (
    <div className="App">
      <Hello name="auqid" heroName="batman"></Hello>
      <Message></Message>
      <Counter></Counter>
      <Welcome name="auqid" heroName="irfan"></Welcome>
      <FunctionClick />
      <ClassClick></ClassClick>
      <EventBind />
      <ParentComponent></ParentComponent>
      <UserGreeting></UserGreeting>
      <NameList></NameList>
      <Practise name="">
        <h1>hello</h1>
      </Practise>
    </div>
  );
}

export default App;
